import MainLayout from '../components/layouts/mainLayout'

class About extends Component{
  constructor(props){
    super(props)
  }

  render(){
    return(
      <>
        <MainLayout>
          <h1>this is about page</h1>
        </MainLayout>
      </>
    )
  }
}

export default About;
